    "Overview of efforts to expand the range of the Rocky Mountain population of trumpeter
    swans",nt"tracking_summary": {ntt"total": 1,ntt"recent": 1nt},nt"groups":
    [],nt"relationships_as_subject": [],nt"revision_timestamp": "2016-10-29T18:57:23.334772",nt"name":
    "overview-of-efforts-to-expand-the-range-of-the-rocky-mountain-population-of-trumpeter-swan",nt"isopen":
    false,nt"url": null,nt"notes": "Near extinction in 1900, by 1992 the Rocky
    Mountain Population (RMP) of Trumpeter Swans (Cygnus buccinator) contained +2200
    swans. The foremost problem facing the RMP is its diminished winter distribution
    and resulting vulnerability. Since 1990, the U.S. Fish and Wildlife Service (USFWS)
    has lead the implementation of range expansion efforts developed and approved by
    the Pacific Flyway Council. Objectives include creating new wintering areas, reducing
    swan numbers at Harriman State Park (HSP), Idaho, to prevent additional habitat
    damage and lessen mortality potential, and terminating artificial feeding at Red
    Rock Lakes National Wildlife Refuge (RRLNWR), Montana. Although much progress has
    been made, these objectives have not yet been achieved. Accomplishments to date
    include: development of techniques and transplanting 962 swans, positive new swan
    behavior patterns at several sites, beginning use of new migration routes, reduction
    of swan numbers at RRLNWR and HSP, improvement of aquatic vegetation at HSP, avoidance
    of high winter mortality, and success of initial steps to terminate artificial feeding
    at RRLNWR. Continued effort is needed to sustain this progress and achieve project
    objectives. Inadequate security from human disturbance is significantly reducing
    the ability of Trumpeter Swans to adapt to new habitats, particularly on the Snake
    River in southwestern Idaho. Creative actions to provide adequate security at release
    sites and along migration routes are essential to the success of range expansion
    efforts. Techniques used in u00b7other flyways to enhance waterfowl hunting through
    creation of security sites could be used to allow RMP Trumpeters to successfully
    pioneer new areas while minimizing impacts to recreational activity.",nt"license_title":
